/// Get OpenAPI schema.
async fn example_meta_get_schema() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: serde_json::Value = client.meta().get_schema().await?;
    println!("{:?}", result);
    Ok(())
}

