/// Generate a CAD model from text.
/// 
/// Because our source of truth for the resulting model is a STEP file, you will always have STEP file contents when you list your generated models. Any other formats you request here will also be returned when you list your generated models.
/// 
/// This operation is performed asynchronously, the `id` of the operation will be returned. You can use the `id` returned from the request to get status information about the async operation from the `/async/operations/{id}` endpoint.
/// 
/// One thing to note, if you hit the cache, this endpoint will return right away. So you only have to wait if the status is not `Completed` or `Failed`.
/// 
/// **Parameters:**
/// 
/// - `kcl: Option<bool>`: If we should output the kcl for the model.
/// - `output_format: crate::types::FileExportFormat`: The format the output file should be converted to. (required)
async fn example_ml_create_text_to_cad() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: kittycad::types::TextToCad = client
        .ml()
        .create_text_to_cad(
            Some(false),
            kittycad::types::FileExportFormat::Stl,
            &kittycad::types::TextToCadCreateBody {
                prompt: "some-string".to_string(),
            },
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}

/// Get API call metrics.
/// 
/// This endpoint requires authentication by a Zoo employee. The API calls are grouped by the parameter passed.
/// 
/// **Parameters:**
/// 
/// - `group_by: crate::types::ApiCallQueryGroupBy`: What field to group the metrics by. (required)
async fn example_api_calls_get_metrics() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: Vec<kittycad::types::ApiCallQueryGroup> = client
        .api_calls()
        .get_metrics(kittycad::types::ApiCallQueryGroupBy::IpAddress)
        .await?;
    println!("{:?}", result);
    Ok(())
}

/// List API calls.
/// 
/// This endpoint requires authentication by a Zoo employee. The API calls are returned in order of creation, with the most recently created API calls first.
/// 
/// **Parameters:**
/// 
/// - `limit: Option<u32>`: Maximum number of items returned by a single call
/// - `page_token: Option<String>`: Token returned by previous call to retrieve the subsequent page
/// - `sort_by: Option<crate::types::CreatedAtSortMode>`
async fn example_api_calls_list() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: kittycad::types::ApiCallWithPriceResultsPage = client
        .api_calls()
        .list(
            Some(4 as u32),
            Some("some-string".to_string()),
            Some(kittycad::types::CreatedAtSortMode::CreatedAtDescending),
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}


/// - OR -

/// Get a stream of results.
///
/// This allows you to paginate through all the items.
use futures_util::TryStreamExt;
async fn example_api_calls_list_stream() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let mut api_calls = client.api_calls();
    let mut stream = api_calls.list_stream(
        Some(4 as u32),
        Some(kittycad::types::CreatedAtSortMode::CreatedAtDescending),
    );
    loop {
        match stream.try_next().await {
            Ok(Some(item)) => {
                println!("{:?}", item);
            }
            Ok(None) => {
                break;
            }
            Err(err) => {
                return Err(err.into());
            }
        }
    }

    Ok(())
}

/// Get details of an API call.
/// 
/// This endpoint requires authentication by any Zoo user. It returns details of the requested API call for the user.
/// 
/// If the user is not authenticated to view the specified API call, then it is not returned.
/// 
/// Only Zoo employees can view API calls for other users.
/// 
/// **Parameters:**
/// 
/// - `id: uuid::Uuid`: The ID of the API call. (required)
use std::str::FromStr;
async fn example_api_calls_get() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: kittycad::types::ApiCallWithPrice = client
        .api_calls()
        .get(uuid::Uuid::from_str(
            "d9797f8d-9ad6-4e08-90d7-2ec17e13471c",
        )?)
        .await?;
    println!("{:?}", result);
    Ok(())
}

