/// Creates an internal telemetry event.
/// 
/// We collect anonymous telemetry data for improving our product.
use std::str::FromStr;
async fn example_meta_create_event() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    client
        .meta()
        .create_event(
            vec![kittycad::types::multipart::Attachment {
                name: "thing".to_string(),
                filename: Some("myfile.json".to_string()),
                content_type: Some("application/json".to_string()),
                data: std::fs::read("myfile.json").unwrap(),
            }],
            &kittycad::types::Event {
                attachment_uri: Some("some-string".to_string()),
                created_at: chrono::Utc::now(),
                event_type: kittycad::types::ModelingAppEventType::SuccessfulCompileBeforeClose,
                last_compiled_at: Some(chrono::Utc::now()),
                project_description: Some("some-string".to_string()),
                project_name: "some-string".to_string(),
                source_id: uuid::Uuid::from_str("d9797f8d-9ad6-4e08-90d7-2ec17e13471c")?,
                type_: kittycad::types::Type::ModelingAppEvent,
                user_id: "some-string".to_string(),
            },
        )
        .await?;
    Ok(())
}

/// Get CAD file center of mass.
/// 
/// We assume any file given to us has one consistent unit throughout. We also assume the file is at the proper scale.
/// 
/// This endpoint returns the cartesian coordinate in world space measure units.
/// 
/// In the future, we will use the units inside the file if they are given and do any conversions if necessary for the calculation. But currently, that is not supported.
/// 
/// Get the center of mass of an object in a CAD file. If the file is larger than 25MB, it will be performed asynchronously.
/// 
/// If the operation is performed asynchronously, the `id` of the operation will be returned. You can use the `id` returned from the request to get status information about the async operation from the `/async/operations/{id}` endpoint.
/// 
/// **Parameters:**
/// 
/// - `output_unit: Option<crate::types::UnitLength>`: The output unit for the center of mass.
/// - `src_format: crate::types::FileImportFormat`: The format of the file. (required)
async fn example_file_create_center_of_mass() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: kittycad::types::FileCenterOfMass = client
        .file()
        .create_center_of_mass(
            Some(kittycad::types::UnitLength::Yd),
            kittycad::types::FileImportFormat::Stl,
            &bytes::Bytes::from("some-string"),
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}

/// Convert CAD file with defaults.
/// 
/// If you wish to specify the conversion options, use the `/file/conversion` endpoint instead.
/// 
/// Convert a CAD file from one format to another. If the file being converted is larger than 25MB, it will be performed asynchronously.
/// 
/// If the conversion is performed synchronously, the contents of the converted file (`output`) will be returned as a base64 encoded string.
/// 
/// If the operation is performed asynchronously, the `id` of the operation will be returned. You can use the `id` returned from the request to get status information about the async operation from the `/async/operations/{id}` endpoint.
/// 
/// **Parameters:**
/// 
/// - `output_format: crate::types::FileExportFormat`: The format the file should be converted to. (required)
/// - `src_format: crate::types::FileImportFormat`: The format of the file to convert. (required)
async fn example_file_create_conversion() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let result: kittycad::types::FileConversion = client
        .file()
        .create_conversion(
            kittycad::types::FileExportFormat::Stl,
            kittycad::types::FileImportFormat::Stl,
            &bytes::Bytes::from("some-string"),
        )
        .await?;
    println!("{:?}", result);
    Ok(())
}

/// Get CAD file density.
/// 
/// We assume any file given to us has one consistent unit throughout. We also assume the file is at the proper scale.
/// 
/// This endpoint assumes if you are giving a material mass in a specific mass units, we return a density in mass unit per cubic measure unit.
/// 
/// In the future, we will use the units inside the file if they are given and do any conversions if necessary for the calculation. But currently, that is not supported.
/// 
/// Get the density of an object in a CAD file. If the file is larger than 25MB, it will be performed asynchronously.
/// 
/// If the operation is performed asynchronously, the `id` of the operation will be returned. You can use the `id` returned from the request to get status information about the async operation from the `/async/operations/{id}` endpoint.
/// 
